import React from 'react';
import { Link } from 'react-router-dom'; //
import './Navigation.css';

function Navigation() {
  return (
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li> //홈 페이지 토글
        <li><Link to="/Control">Control</Link></li> //컨트롤 페이지 토글
        <li><Link to="/Data">Data</Link></li> //DB데이터 페이지 토글
      </ul>
    </nav>
  );
}

export default Navigation;
